import React from 'react';
import Navbar from './components/Navbar/Navbar';
import Slider from './components/Slider/Slider';
import Featured from './components/Featured/Featured';

class App extends React.Component {
  render () {
    return (
      <div className="App">
        <Navbar />
        <Slider />
        <Featured />
      </div>
    );
  }
}

export default App;
